'use client'

import React, { useState, useEffect } from 'react';
import Typewriter from 'typewriter-effect';
import Randomize from '../randomize/page';
import CustomPage from '@/app/custom/page';
import styles from '../(styles)/Home.modules.css'

const Home = () => {
  const [isRandomPage, setIsRandomPage] = useState(false)
  const [isCustomPage, setIsCustomPage] = useState(false)
  return (
    <div className={styles.container}>
      <div className="bg-blue-500 text-white p-4 titleContainer">
         <img src="data:image/webp;base64," alt="Logo" width={"200px"} height={"100px"}/>
         <a href="/about" className="text-3xl font-arial antialiased font-bold pr-4">ABOUT US</a>
      </div>
      <div className="bg-[#222021] container mx-auto">
        <div className={`text-lg font-bold mt-4 title ${styles.fade}`}>
          <h1>Plan a trip to</h1>
          <Typewriter
            options={{
              strings: ['your dream destination','Japan', 'London', 'Amsterdam', 'New York', 'Casablanca', 'Shanghai'],
              autoStart: true,
              loop: true,
            }}
          />
        </div>
        <div className="mt-4">
          <button 
            className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded mr-2"
            onClick={()=> {
              setIsRandomPage(!isRandomPage);
              setIsCustomPage(false);
            }}  
          >
            Pick for me
          </button>
          <button 
            className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded"
            onClick={()=> {
              setIsCustomPage(!isCustomPage);
              setIsRandomPage(false);
            }}  
          >
            Plan my trip
          </button>
        </div>
      </div>  
      {/* Page for planners */}
      {/* Logic 
      On button click render specific page */}
      {isRandomPage && (
        <div>
            <Randomize/>
        </div>
      )}
      {isCustomPage && (
        <div>
            <CustomPage/>
        </div>
      )}

    </div>
  );
}


export default Home;